import React from 'react';
import { Container, Typography, AppBar, Toolbar, InputLabel, Select, Grid, Button } from '@material-ui/core';
import {SellerTopMenu}  from './SellerTopMenu';
import useStyles from './styles';
import { useForm, FormProvider } from "react-hook-form";

const SellerDashboard = ({props}) => {
    const test = props;
    const classes = useStyles();
    console.log("----",test);
    return (
        <>
          <Typography variant="h6" gutterBottom>
            Shipping Address
          </Typography>

          <FormProvider {...methods}>
            <form
              onSubmit={methods.handleSubmit((data) =>
                next({
                  ...data,
                  shippingCountry,
                  shippingSubdivision,
                  shippingOption
                })
              )}
            >
              <Grid container spacing={3}>
                <FormInput required name="productName" label="Product Name" />
                <FormInput required name="price" label="Price $" />
                <FormInput required name="description" label="Description" />
                <FormInput required name="quantity" label="quantity" />
              </Grid>
              <br />

              <div style={{ display: "flex", justifyContent: "space-between" }}>
                <Button component={Link} to="/cart" variant="outlined">
                  Back to cart
                </Button>
                <Button type="submit" variant="contained" color="primary">
                  Next
                </Button>
              </div>
            </form>
          </FormProvider>
        </>
      );
}

export default SellerDashboard;
